import React from 'react';
import './LastTwoOperations.css'; 

const LastTwoOperations = (props) => {
    return(
        <div className={props.choice}>
        <div className="operationText"> 
            <p> {props.operation} </p> 
        </div>
        </div>
    )
} 

export default LastTwoOperations;
